\":\"_blank\",\"title\":null,\"type\":\"url\",\"value\":\"http://blog.bcwinstitute.org/87-organizations-honored-as-certified-best-christian-workplaces-2018/\"}',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(12,15,1,'Building Lights Bw','2018-12-08 01:31:48','2018-12-08 01:31:48','38690095-df00-48a9-a17e-dabcf402f0ff',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(13,18,1,'Mark Webster Testimonial','2018-12-30 16:13:20','2019-09-15 13:04:04','d062c3b0-d937-49c7-aae5-1811c6b1dd62',NULL,NULL,NULL,NULL,NULL,'Mark Webster','Mark Macurdy was working at a job site over the weekend (emergency call) and needed some parts to get a 600 ton chiller up for a customer. Mark called the after hours number and got Jeff. Mark said that he not only got the part for him, he dropped it off at the job site so Mark never had to stop working but he also dropped off some water for Mark as well. Mark could not say enough about the professional manner in how he handled having to come out on Sunday (102 degrees) but he went the extra step to make sure Mark was hydrated! Please recognize this young man in front of your group for going the extra mile. Troy, you know as well as anyone that parts are parts and everyone has them BUT, very few companies find people who go the extra mile. This guy will help ACR keep customers for life!',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(17,22,1,NULL,'2018-12-30 16:43:46','2019-05-11 15:35:34','4c99e85d-27f7-422c-864e-69033787cee9',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'https://itunes.apple.com/app/acr-supply-store/id1122845601','https://play.google.com/store/apps/details?id=io.gonative.android.pdzwn','https://www.facebook.com/acrsupply/','North Carolina\'s leading HVAC and Refrigeration wholesale distributor.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,