 will help ACR keep customers for life!',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(120,1666,1,'Home','2019-08-25 00:20:39','2019-08-25 00:20:39','c738edb9-6753-412d-91a6-f0f4f4720b83',NULL,NULL,NULL,'What We Do Best','As the weather cools, you may be seeing pests around your house. In the fall months, here are some things to be on the lookout for:',NULL,NULL,'Stay Updated With ACR','Get VIP access for early announcements for all our events and sales.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(121,1672,1,'Home','2019-08-25 00:20:39','2019-08-25 00:20:39','c7ba0385-cf1f-454a-93c2-54ed9e19e453',NULL,NULL,NULL,'What We Do Best','As the weather cools, you may be seeing pests around your house. In the fall months, here are some things to be on the lookout for:',NULL,NULL,'Stay Updated With ACR','Get VIP access for early announcements for all our events and sales.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(122,1678,1,'Home','2019-08-25 00:20:39','2019-08-25 00:20:40','1e5caa9b-b0b3-416f-9f62-60b960c41663',NULL,NULL,NULL,'What We Do Best','As the weather cools, you may be seeing pests around your house. In the fall months, here are some things to be on the lookout for:',NULL,NULL,'Stay Updated With ACR','Get VIP access for early announcements for all our events and sales.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(123,1684,1,'Home','2019-08-25 00:20:40','2019-08-25 00:20:40','6c9dcc0a-26fd-44ef-8e0e-358677249645',NULL,NULL,NULL,'What We Do Best','As the weather cools, you may be seeing pests around your house. In the fall months, here are some things to be on the lookout for:',NULL,NULL,'Stay Updated With ACR','Get VIP access for early announcements for all our events and sales.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(124,1690,1,'Home','2019-08-25 00:20:40','2019-0