mp','2019-08-29 00:41:38','2019-11-03 01:35:21','87e03162-f03d-4d64-b95f-910721c30bc2',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,5,'ACR Supply 4040 S. Alston Ave Durham NC, 27113',NULL,595.00,NULL,NULL,NULL,NULL,'<p>DDC Systems are in most commercial properties and can save the end user up to 38% on heating and cooling power bills. Training and educating your team to work on that end user DDC projects can help your bottom line. </p>\n<p>The course instructor is Ron Auvil! He has taught DDC controls for Johnson Controls and other leading DDC systems. Ron will help you understand the value in obtaining basic DDC system knowledge while understand function of basic components and how they work to control HVAC mechanical systems. </p>\n<ul><li>Prerequisite: None</li><li>Course Length: 2 Day 8am-4pm</li></ul><p>	</p>\n<p><strong>Who the course is for:</strong></p>\n<ul><li>New hires or for those just now coming into DDC Control Systems.</li>\n<li>HVAC service technicians</li>\n<li>Maintenance Staff, colleges, hospitals, and schools</li></ul><p><strong>Skills Learned:</strong></p>\n<ul><li>Background and terminology for DDC.</li>\n<li>Overview of Commercial HVAC Systems such as VAV</li>\n<li>Introduction to basic programming types</li>\n<li>Log into a front end and perform typical tasks</li>\n<li>Basic Level 1 Troubleshooting skills</li>\n<li>Hands-On Labs.</li>\n</ul><p><strong>About The Instructor:</strong></p>\n<p>Ron Auvil has 40 years of HVAC and Controls Experience. He has worked as a senior controls technician for Johnson Controls. He has also taught HVAC and Controls classes across the United States for Johnson Controls, Honeywell, and others. He has written several textbooks; ‘HVAC and Refrigeration Systems’ and ‘HVAC Control Systems’ both from American Technical Publishers.</p>','[\"soldOut\"]',NULL),(198,1917,1,'Course #231-PCT Basics','2019-08-29 00:44:06','2019-11-03 01:35:36','ca652ede-8e72-4398-9d5f-eaf41ec78c81',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,6,'ACR Supply 4040 S. Alston Ave. Durham NC, 27713',NULL,895.00,NULL,NULL,NULL,NULL,'<p>This course is designed for those who need to know the basics of using the PCT Tool. </p>\n<p>Participants will receive an overview of the Facility Explorer MSTP Field Controller system, create programs from standard tree systems using the programmable Controller and Commissioning Tool, then connect using the MAP sensor to upload and download code into the controllers after setting up the hardware and software to communicate properly.</p>\n<p><strong>Note:</strong> All class room materials are provided. Lunch and snacks included.</p>\n<p>For End Users and/or Authorized Building Controls Specialists/Contractors only.</p>\n<ul><li>Prerequisite: None</li><li>Course Length: 2 Days 8am-4pm</li></ul><p><strong>Topics:</strong></p>\n<ul><li>Introduction to the Facility Explorer MSTP Field Controllers System</li><li>PCT Software Basics</li><li>Using PCT Help</li><li>MSTP Controller Hardware</li><li>Creating Applications Using the Standards Tree</li><li>Adding Points to Existing Controllers</li><li>Using MAP sensor to Connect to Controllers; Discussion of Bluetooth Setup for BTCVT</li><li>Uploading and Downloading Controllers</li><li>Commissioning Controllers, Inputs and Outputs</li></ul><p><strong>About The Instructor:</strong></p>\n<p>Ron Auvil has over 40 years of HVAC and Controls Experience. He has worked as a senior controls technician for Johnson Controls. He has also taught HVAC and Controls classes across the United States for Johnson Controls, Honeywell, and others. He has written several textbooks; ‘HVAC and Refrigeration Systems’, ‘HVAC Control Systems’ and ‘IT for HVAC Technicians’, all both from American Technical Publishers..</p>','[\"soldOut\"]',NULL),(199,1918,1,'Course #304- Commercial HVAC Bootcamp','2019-08-29 00:47:09','2019-11-03 01:20:04','8006a671-63e1-46f5-b635-8be63cd5feff',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,7,'ACR Supply 200 Seneca Rd, Greensboro NC 27406',NULL,595.00,NULL,NULL,NULL,NULL,'<p>During this training your team will obtain an in-depth knowledge of typical commercial HVAC building systems. Identify major control system types and components. Save money with fewer service calls and complaints. Prepare technicians for advanced DDC and mechanical skills.</p>\n<ul><li>Prerequisite: None</li><li>Course Length: 2 Day 8am-4pm</li></ul><p><strong>Who the course is for:</strong></p>\n<ul><li>New hires, especially residential technicians now working in a commercial building environment. </li>\n<li>HVAC service technicians</li>\n<li>Maintenance Staff, colleges, hospitals, and schools</li>\n</ul><p><strong>Skills Learned:</strong></p>\n<ul><li>Importance of comfort in commercial buildings. </li>\n<li>Typical commercial building HVAC systems with emphasis on VAV.</li>\n<li>Hot water and chilled water piping systems including 2 pipe changeover and primary secondary.</li>\n<li>Typical chiller plant sequence of operation.</li>\n<li>Chiller and cooling tower operation.</li>\n<li>Commercial boiler types and operation. </li>\n<li>Control system components, including inputs, outputs, and control loops.</li>\n<li>Air handler types and configurations.</li>\n<li>Economizer control types.</li>\n<li>Hands on labs.</li>\n</ul><p><strong>About The Instructor:</strong></p>\n<p>Ron Auvil has 40 years of HVAC and Controls Experience. He has worked as a senior controls technician for Johnson Controls. He has also taught HVAC and Controls classes across the United States for Johnson Controls, Honeywell, and others. He has written several textbooks; ‘HVAC and Refrigeration Systems’ and ‘HVAC Control Systems’ both from American Technical Publishers.</p>','[]',NULL),(200,1919,1,'Course #204-Pneumatic HVAC Controls','2019-08-29 02:20:30','2019-11-03 01:20:04','58771cfe-d8b0-468c-bad7-a30b7f15041a',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,9,'ACR Supply 200 Seneca rd., Greensboro NC 27406',NULL,199.00,NULL,NULL,NULL,NULL,'<p>Pneumatic Control Systems make up approximately 20% of all controls in commercial buildings today. Unfortunately, many of the technicians that worked on these systems have retired. </p>\n<p>The course instructor is Ron Auvil! He has taught pneumatic controls for both Honeywell and Johnson Controls. This course will be chock full of practical field insights that technicians need to know to maintain and troubleshoot their pneumatic control systems. It will cover multiple manufacturers and generations of controls. </p>\n<ul><li>Prerequisite: None</li><li>Course Length: 1 Day 8am-4pm</li></ul><p><strong>COURSE TOPICS:</strong></p>\n<ul><li>Air Compressor Station and Maintenance</li>\n<li>Pneumatic Actuators, Dampers and Valves</li>\n<li>Pneumatic Thermostats; 1 and 2 pipe; Day/Night and Winter/Summer Thermostats</li>\n<li>Thermostat Calibration Procedures </li>\n<li>Humidistats and Pressure stats</li>\n<li>Pneumatic Transmitters</li>\n<li>Pneumatic Receiver Controllers; 1 and 2 input types</li>\n<li>Receiver Controller Calibration Procedures</li>\n<li>Auxiliary Devices</li>\n</ul><p><strong>About The Instructor:</strong></p>\n<p>Ron Auvil has 40 years of HVAC and Controls Experience. He has worked as a senior controls technician for Johnson Controls. He has also taught HVAC and Controls classes across the United States for Johnson Controls, Honeywell, and others. He has written several textbooks; ‘HVAC and Refrigeration Systems’ and ‘HVAC Control Systems’ both from American Technical Publishers. </p>','[]',NULL),(201,1920,1,'Associated Partnerships','2019-08-29 14:20:23','2019-08-29 14:20:23','59da4b62-13e6-433f-baa7-0b4cf6e7603e',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(202,1924,1,'Sept19 Web Promo 3','2019-08-29 14:44:55','2019-08-29 14:44:55','7e3a3483-6ccc-485c-8aaf-0a90c1c2a977',NULL,NULL,NU