INSERT INTO `acr_matrixcontent_acrcaresinitiatives` VALUES (1,35,1,'2019-01-23 02:51:12','2019-05-30 00:29:40','49c288a6-2efc-434e-ace5-f225bd42407e','Roc Solid Foundations','Roc Solid Foundation® builds hope for children battling cancer and their families by offering opportunities for them to do what they do best – play. Roc Solid partners with local groups to build playsets and remodel the rooms of children battling cancer. ACR Cares will be building a playset with Roc Solid October 2018.'),(2,36,1,'2019-01-23 02:51:12','2019-05-30 00:29:40','a5e84a94-675d-4a86-9f7f-61485f790343','Ronald McDonald House','Providing stability and resources for families everywhere. ACR Cares partners with the local Ronald McDonald House’s to cook meals, provide gifts and needed materials at Christmas time, and sponsors a family every Christmas.'),(3,37,1,'2019-01-23 02:56:28','2019-05-30 00:29:40','dd049d01-d836-43ea-893d-36fe22748ef0','Operation Resolute','Operation Resolute® is a non-profit organization based in North Carolina that is dedicated to sustaining and strengthening families within the US Armed Forces by serving with and working through military chaplains. By partnering with chaplains, Operation Resolute® works within the parameters of the US military while adorning the Gospel by being salt and light. ACR Cares partners with Operation Resolute by hosting Daddy Daughter dances, spouse retreats, and other events.'),(4,38,1,'2019-01-23 02:56:29','2019-05-30 00:29:40','171df002-ad5b-4f37-8d90-065bbf622483','Burkina Faso','ACR Cares is currently building an Orphanage in the country of Burkina Faso.'),(5,39,1,'2019-01-23 02:56:29','2019-05-30 00:29:40','6ae0b968-7530-4fb8-bc0e-1085db32bcc9','Human Coalition','Human Coalition is a group dedicated to helping women at risk of having an abortion see the beauty of choosing life. ACR Cares takes part in the annual  fundraising event, 4000 Steps.'),(6,506,1,'2019-08-25 00:20:05','2019-08-25 00:20:06','b02c79ed-e5cf-446a-9b0c-4f513982a