fc-21d3fe2276bf','I think everyone has a great culture within there dept or stores.'),(42,109,1,'2019-02-05 02:46:20','2019-10-29 00:42:02','7dc9442e-5b54-4a43-a2c6-08b2e7e0b26c','I think the culture is waning.  People are feeling overwhelmed and under appreciated.'),(43,110,1,'2019-02-05 02:46:20','2019-10-29 00:42:02','8b26a9c4-0888-4f9c-9c8c-fd60f430ef10','I would describe the culture at ACR as one with a high emphasis on meeting customer requests. We are not the cheapest supplier but I believe we have the best inside sales representatives in the area, which drives the customer experience. I think people have bought into that culture and enjoy the teams they work with. For the most part and on a consistent basis, I believe people truly enjoy coming to work each day and that is a noteworthy accomplishment for any leadership team.'),(44,111,1,'2019-02-05 02:46:20','2019-10-29 00:42:02','f7bd0f7e-045c-4a77-9168-e0c497d17072','It is a place where we are appreciated for our hard work and contributions to make the whole company succeed.'),(45,112,1,'2019-02-05 02:46:20','2019-10-29 00:42:02','136e2dff-ff24-43a5-8494-7a9b1521f2fe','It is one of family and friends, caring about making sure each of us wants to come to work.'),(46,113,1,'2019-02-05 02:46:20','2019-10-29 00:42:02','6abd983d-8cf3-462e-9e1d-b075b335c287','It is one that is about serving people, both inside the company and outside.'),(47,114,1,'2019-02-05 02:46:20','2019-10-29 00:42:02','7087bfd3-e9e0-426f-851b-1ff64ef054a2','It stay true to the Mission of Glorify God'),(48,115,1,'2019-02-05 02:46:20','2019-10-29 00:42:02','5bab8fdf-10e1-406b-8e2d-1f8f79e728b8','Culture is great and the people are friendly and helpful'),(49,116,1,'2019-02-05 02:46:20','2019-10-29 00:42:02','cdefee2a-79d8-45b7-aa13-56a1a4fd3208','it\'s a culture built on RESPECT and LOVE'),(50,117,1,'2019-02-05 02:46:20','2019-10-29 00:42:02','367d4f2d-6244-4360-9b42-a88f9f7b952a','It\'s a culture the demands my best, while simultaneously foste